# Calculating Protein Mass
# Original problem: http://rosalind.info/problems/prtm/
# Solution by Matthew Masters

import numpy as np

dna_data = ""
motif = "TTATCACTT"

last = dna_data.find(motif)+1
output = [str(last)]

while True:
    last = dna_data.find(motif,last,len(dna_data))+1
    if last == 0:
        break
    output.append(str(last))

print(' '.join(output))